tables.table_schema:
CREATE TABLE data_cleanup_tasks (
    task_id SERIAL PRIMARY KEY,
    task_name VARCHAR(255) NOT NULL,
    task_description TEXT,
    task_status BOOLEAN
);

CREATE TABLE data_cleaning_tasks (
    task_id SERIAL PRIMARY KEY,
    task_name VARCHAR(255) NOT NULL,
    task_description TEXT,
    task_status BOOLEAN
);

CREATE TABLE preprocessing_tasks (
    preprocess_id SERIAL PRIMARY KEY,
    preprocess_name VARCHAR(255) NOT NULL,
    preprocess_description TEXT,
    preprocess_status BOOLEAN
);

CREATE TABLE data_cleaning_tasks (
    task_id INT PRIMARY KEY,
    task_name VARCHAR(50) NOT NULL,
    task_description TEXT,
    task_status VARCHAR(20) DEFAULT 'Pending'
);

CREATE TABLE data_preprocessing_steps (
    step_id INT PRIMARY KEY,
    step_name VARCHAR(50) NOT NULL,
    step_description TEXT,
    step_order INT
);

CREATE TABLE data_cleaning_logs (
    log_id INT PRIMARY KEY,
    task_id INT,
    log_timestamp TIMESTAMP,
    log_description TEXT
);

CREATE TABLE preprocessing_logs (
    log_id INT PRIMARY KEY,
    step_id INT,
    log_timestamp TIMESTAMP,
    log_description TEXT
);

CREATE TABLE cleaning_step_mapping (
    task_id INT,
    step_id INT,
    FOREIGN KEY (task_id) REFERENCES data_cleaning_tasks(task_id),
    FOREIGN KEY (step_id) REFERENCES data_preprocessing_steps(step_id)
);
